//종료 처리
function onConfirmExit(button) {
    if(button==1){//If User selected No, then we just do nothing
        navigator.app.exitApp();
    } else {
        return;
    }
}
//학습종료 처리
function onConfirmStudyExit(button) {
    if(button==1){//If User selected No, then we just do nothing
        oggPlayer.stop();
        clearCanvas();

        setPage('cabinet');
    } else {
        return;
    }
}

