function showAlert(msg, title) {
    if (navigator.notification) {
        navigator.notification.alert(
            msg,  // message
            null,         // callback
            title,            // title
            '확 인'                  // buttonName
        );
    } else {
        alert(msg);
    }
}

function setProgress(no) {
    $(".progress-bar").attr("aria-valuenow",no);
    $(".progress-bar").css("width",no+"%");
    $("#progresstitle").text(no+"%");
}

var isProgress=false;
function goProgress() {
    isProgress=true;

    if (nowloadingrate==0) viewLoading("block");
    setTimeout(function() {
        if (nowloadingrate<=100) {
            setProgress(nowloadingrate);
            nowloadingrate=nowloadingrate+2;
            goProgress();
        } else {
            isProgress=false;
            nowloadingrate=0;
            viewLoading('none');
            setProgress(nowloadingrate);

            if (nowpage=='cabinet') {
                showBooks();
            }
            if (nowpage=='writing') {
                //KeyBoard.showKeyboard();
            } else if (nowpage=='dictation') {
                dictation.startStudy();
            } else if (nowpage=='speaking') {
                speaking.startStudy();
            } else if (nowpage=='speaking2') {
                speaking2.startStudy();
            } else if (nowpage=='listening') {
                listening.startStudy();
            } else if (nowpage=='popquiz') {
                popquiz.startStudy();
            } else if (nowpage=='shadow') {
                shadow.init();
            } 

        }
    }, 100);
}

